import { useEffect, useState } from "react";



const PrayerGet = () => {
  const [requests] = useState(null)
  useEffect(() => {
    fetch('http://localhost:8000/requests')
      .then(res => {
        return res.json();
      })
    })
  
  return (
    <div className="currentreq">
      {requests.map(post => (
        <div className="post-preview" key={post.id} >
          
          <p>{ post.name}</p>
          <p>{ post.location}</p>
          <p>{ post.body}</p>
        </div>
      ))}
    </div>
  );
  };
  
  export default PrayerGet;
